import { FiAlignRight } from "react-icons/fi";
import logo from "./img/logo.png"
const Header = ()=>{
const [show, hide] = useState(false);
const Mobile_icon = ()=>{
    hide(!show);
}

return (
<div className="main_header">

<div className="nav_header">

<div className="logo_header">
<img src={logo}/>
</div>
<div  className="nav_manu">
<ul className={show? "nav_ul":"nav_update"}>
<li>About</li>
<li>Service</li>
<li>Clint</li>
<li>Work</li>
<li id="contact_manu" >Contact</li>

</ul>



</div>
<div className="mobile_manu">
   <div className="icon">
 <FiAlignRight onClick={Mobile_icon}/>
    </div>


</div>
</div>

</div>
)


}
export default Header;
